pragma solidity ^0.8.28;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

interface ICarmelVerifier {
    function verify(bytes32 digest, bytes calldata signature, uint256 x, uint256 y) external view returns (bool);
}

/// @title The Carmel Registry
/// @author I. Dan Calinescu
/// @notice This keeps track of all Carmel Accounts and associated data such as public keys
/// @custom:oz-upgrades-unsafe-allow external-library-linking
contract CarmelRegistry is Initializable {
    /// @dev Constants used to track permissions
    uint8 constant private ADMIN_PERM = 99;
    uint8 constant private SENTINEL_PERM = 50;
    uint8 constant private START_PERM = 1;

    /// @dev The address of the Carmel Verifier used to verify signatures
    ICarmelVerifier private _verifier;

    /// @notice This represents an individual Carmel Fingerprint
    struct Fingerprint {
        uint256 keyId;
        bytes32 username; 
        bytes32 message;
        bytes signature;
    }

    /// @notice This represents an individual Carmel Account
    struct Account {
        uint256 id;
        bytes32 username;
        bytes32 group;
        uint32 total_keys;
        uint32 total_addresses;
    }

    /// @notice The total accounts available in this registry
    uint256 public total_accounts;

    /// @dev Keep track of the main owner of this registry
    address public owner;

    mapping(bytes32 => uint256[]) public keys_x;
    mapping(bytes32 => uint256[]) public keys_y;
    mapping(address => uint8) public perms;
    mapping(bytes32 => Account) public accounts;
    mapping(bytes32 => bytes32[]) public usernames;
    mapping(bytes32 => address[]) public addresses;

    /// @notice Helper to ensure sentinel permissions on a function
    modifier requireSentinel() {
      require(perms[msg.sender] >= SENTINEL_PERM, "Sentinel level required");
      _;
    } 

    /// @notice Helper to ensure admin permissions on a function
    modifier requireAdmin() {
      require(perms[msg.sender] >= ADMIN_PERM, "Admin level required");
      _;
    }

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function version() public pure returns (uint16) {
        return 1;
    }

    function initialize(
        address sender,
        address ver
    ) initializer public {
        perms[sender] = ADMIN_PERM;
        owner = sender;
        _verifier = ICarmelVerifier(ver);
    }

    /// @notice Register a brand new Carmel account into this registry
    /// @param username The Carmel username (must be unique)
    /// @param grp The Carmel group to which this username will be added (ex: "users")
    /// @param addr The address associated with this account
    function register (bytes32 username, bytes32 grp, address addr) public requireSentinel returns (uint256) {
        Account memory account = accounts[username];
        require(account.username == bytes32(0), "The username already exists");

        uint256 accountId = total_accounts;

        Account memory acct = Account({ id: accountId, group: grp, username: username, total_keys: 0, total_addresses:1 });
        accounts[username] = acct;

        addresses[username].push(addr);
        usernames[grp].push(username);

        total_accounts = total_accounts + 1;

        return accountId;
    }

    /// @notice Check if an account exists for a particular username
    // function accountContractExists (bytes32 username) public view returns (bool) {
    //     Account memory account = accounts[username];
    //     require(account.username != bytes32(0), "The username does not exist");

    //     address addr = getAccountAddress(account.id);
    //     return (addr.code.length > 0);
    // }

    /// @notice Get a list of all accounts within a particular group
    /// @param grp The group to look up
    /// @return All the accounts within the group
    function group(bytes32 grp) public view returns (Account[] memory) {
        bytes32[] memory all = usernames[grp];
        uint total = all.length;
        Account[] memory accts = new Account[](total);

        for(uint i = 0; i < total; i++) {
            accts[i] = accounts[all[i]];
        }

        return accts;
    }

    /// @notice
    function updatePerms (address addr, uint8 level) public requireAdmin {
        perms[addr] = level;
    }

    /// @notice Add a new public key associated with an account
    /// @param username The account username
    /// @param x The x coordinate of the key
    /// @param y The y coordinate of the key
    function addKey (bytes32 username, uint256 x, uint256 y) public requireSentinel {
        Account memory account = accounts[username];
        require(account.username != bytes32(0), "The account does not exist");

        keys_x[username].push(x);
        keys_y[username].push(y);
        accounts[username].total_keys = account.total_keys + 1;
    }

    /// @notice Sign with 
    function sign (Fingerprint memory fingerprint) public view requireSentinel returns(bool) {
        Account memory account = accounts[fingerprint.username];
        require(account.username != bytes32(0), "The account does not exist");
        require(keys_x[fingerprint.username].length > fingerprint.keyId && keys_y[fingerprint.username].length > fingerprint.keyId, "Invalid device");

        uint256 x = keys_x[fingerprint.username][fingerprint.keyId];
        uint256 y = keys_y[fingerprint.username][fingerprint.keyId];

        return _verifier.verify(fingerprint.message, fingerprint.signature, x, y);
    }

    /// @notice
    // function getAccountAddress(uint256 accountId) public view returns (address) {
    //     bytes memory accountInit = abi.encodeCall(CarmelAccount.initialize, (bytes32(0), entryPointAddress, verifierAddress, bytes32(0), bytes32(0)));
    //     bytes memory proxyConstructor = abi.encode(address(accountImpl), accountInit);
    //     bytes memory bytecode = abi.encodePacked(type(ERC1967Proxy).creationCode, proxyConstructor);
    //     bytes32 bytecodeHash = keccak256(bytecode);

    //     return Create2.computeAddress(bytes32(accountId), bytecodeHash);
    // }

    // bytes memory accountInit = abi.encodeCall(CarmelAccount.initialize, (username, entryPointAddress, verifierAddress, x, y));
    // ERC1967Proxy proxy = new ERC1967Proxy{salt: bytes32(accountId)}(address(accountImpl), accountInit);
}

